pragma solidity ^0.8.7;

// Tipos de estructuras de datos

/*

    Struct
      
      Las estructuras nos permiten definir tipos de datos mas complejos

        struct <nombre_estrucura> {
             <data_type_1> <nombre_variable_1>;
        <data_type_2> <nombre_variable_2>;
        <data_type_3> <nombre_variable_3>;
        ...
        }


    Mapping
      
      Asociacion clave-valor para guardar y ver datos
    
        mapping (_keyType => _valueType) [public]* <nombre_mapping>;


    Arrays

      Tipo de dato estructurado que almacena un conjunto homogeneo de datos

        <tipo_dato> [] [public]* <nombre_array>;

*/
